import React from 'react';
import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Topbar from './components/Topbar';
import NavBar from './components/NavBar';


function App() {
  return (
    <div className="app">
      <Topbar/>
      <BrowserRouter>
        <NavBar/>
      </BrowserRouter>
      {/*<NavBar/> */}
    </div>
  );
}

export default App;
